namespace Lof\ShopByBrand\Controller\Adminhtml\Items;

class Index extends \Lof\ShopByBrand\Controller\Adminhtml\Items
{
    /**
     * Items list.
     *
     * @return \Magento\Backend\Model\View\Result\Page
     */
    public function execute()
    {
        /** @var \Magento\Backend\Model\View\Result\Page $resultPage */
        $resultPage = $this->resultPageFactory->create();
        $resultPage->setActiveMenu('Ves_All::ves_all');
        $resultPage->getConfig()->getTitle()->prepend(__('Shop By Brand'));
        $resultPage->addBreadcrumb(__('Lof'), __('Lof'));
        $resultPage->addBreadcrumb(__('Items'), __('Shop By Brand'));
        return $resultPage;
    }
}
